(24, 1, 'Personal Accident, Medical & Auto Assistance - Silver', 'zh Personal Accident, Medical & Auto Assistance - Silver', '388', '此保障專為車主而設，在意外中同時保障了投保者及該投保車輛之乘客。\n', 'The coverage is designed for car owners and will protect the policyholder as well as passenger in the vehicle in the event on an accident. \n', 'http://kwiksure.localhost/assets/motor/ks-motor.png', 'http://kwiksure.localhost/assets/motor/ks-motor.png'),
