(25, 1, 'Personal Accident, Medical & Auto Assistance - Gold', 'zh Personal Accident, Medical & Auto Assistance - Gold', '788', '此保障專為車主而設，在意外中同時保障了投保者及該投保車輛之乘客。\n保障範圍非常全面，金計劃及白金計劃更包括緊急路邊支援及拖車服務。\n', 'The coverage is designed for car owners and will protect the policyholder as well as passenger in the vehicle in the event on an accident. \nThe Gold and Platinum Plan include emergency road side assistance and towing should you have an accident or vehicle breakdown.\n', 'http://kwiksure.localhost/assets/motor/ks-motor.png', 'http://kwiksure.localhost/assets/motor/ks-motor.png'),
